import React from 'react';
import {
  Container,
  Paper,
  Typography
} from '@material-ui/core';

import { employeeData, count } from '../data';

export default class Content extends React.Component{
  render(){
    return(
      <Container>
        <Typography>Summary</Typography>
        <Paper>
          <Typography>Employees Enrolled: {count(employeeData)}</Typography>
        </Paper>
        <Typography>Activation Summary</Typography>
        <Paper>
          <Typography>Activated</Typography>
        </Paper>
      </Container>
    );
  };
};
